@-moz-document domain("urbandictionary.com") {
 ::-webkit-scrollbar {
 	/* Width */
 	width: 1.2em!important;
 }

 /* Color of handle ___________________________________________________________________________*/

 ::-webkit-scrollbar-thumb {
 	background: #580303!important;
 	background-image: linear-gradient(to right, rgba(93, 6, 6, 0.95), rgba(255, 4, 4, 0.1)), url(https://image.ibb.co/hCq4n5/Carbon_Fiber_2.jpg)!important;
 	box-shadow: inset 0 0 5px rgba(0, 0, 0, .4), rgba(55, 55, 55, 1) 0 1px 0!important;
 	border-radius: 22px!important;
 	border: 1px solid rgba(0, 0, 0, .25)!important;
 }

 ::-webkit-scrollbar-thumb:hover {
 	background: #580303!important;
 	background-image: linear-gradient(to left, rgba(93, 6, 6, 0.95), rgba(255, 4, 4, 0.1)), url(https://image.ibb.co/hCq4n5/Carbon_Fiber_2.jpg)!important;
 	border-radius: 22px!important;
 	box-shadow: inset 0 0 5px rgba(0, 0, 0, .4), rgba(155, 155, 155, 1) 0 1px 0!important;
 }

 /* Color of Track ______________________________________________________________________________*/

 ::-webkit-scrollbar-track {
 	background: #170000!important;
 	box-shadow: inset 8px 0 13px rgba(0, 0, 0, .4), rgba(55, 55, 55, 1) 0 1px 0!important;
 	border: 1px solid rgba(0, 0, 0, .25)!important;
 }

 /* Color of handles at top and bottom ___________________________________________________________*/

 ::-webkit-scrollbar-button {
 	background: #4c0707!important;
 	box-shadow: inset 0 12px 13px rgba(0, 0, 0, 0.6), rgba(55, 55, 55, 1) 0 1px 0!important;
 }

 ::-webkit-scrollbar-button:hover {
 	border-radius: 22px!important;
 	box-shadow: inset 0 0 5px rgba(0, 0, 0, .4), rgba(155, 155, 155, 1) 0 1px 0!important;
 }

 /* Color of the bottom corner of the scrollable element, where two scrollbar meet. ______________*/

::-webkit-scrollbar-corner
 {
 	background: #530205!important;
 	box-shadow: inset 0 12px 13px rgba(0, 0, 0, 0.6), rgba(55, 55, 55, 1) 0 1px 0!important;
 }

::-webkit-scrollbar-corner:hover
 {
 	border-radius: 22px!important;
 	box-shadow: inset 0 0 5px rgba(0, 0, 0, .4), rgba(155, 155, 155, 1) 0 1px 0!important;
 }

}

@-moz-document url-prefix("http://platform.twitter.com/"), url-prefix("https://platform.twitter.com/"), url-prefix("https://www.facebook.com/plugins"), domain("urbandictionary.com"), domain("twitter.com") {
/*_____________________________________________________________________________________*/

* {
	text-decoration: none!important;
}

#slogan-hidden,
.panel h4,
.slogan-container,
.slogan-panel .like_buttons a {
	text-transform: capitalize!important;
}

.def-footer .circle-link .svgicon svg,
.def-footer .thumbs .svgicon svg {
	fill: #e4c7c7!important;
}

.def-panel .thumbs .up,
.def-panel .thumbs .down,
.filter-panel ul li,
.panel {
	border: none!important;
	box-shadow: none!important;
}

/*___ Fonts __________________________________________________________________________________*/

body {
	font-family: Roboto, Arial, sans-serif!important;
}

.collection-panel .title .highlight {
	font-size: 21px!important;
}

body {
	font-size: 21px!important;
}

/*___ Remove Items ___________________________________________________________________________*/

[class*="-ad"]:not(.svgicon-add202) {
	left: -9999px!important;
	position: absolute!important;
	top: -9999px!important;
}

/*___ Left/Right/Top/Bottom ___________________________________________________________________*/

.large-4,
.small-12 {
	top: 2rem;
}

.search-and-actions .main-actions a {
	margin-bottom: -0.65em!important;
}

.def-panel .example {
	margin: 1em 0 1em 2rem!important;
}

.columns.search-and-actions {
	top: 0rem;
	width: 90%!important;
}

#outer {
	margin-top: 0!important;
}

/*___ Margins _______________________________________________________________________________*/

.large-4,
.large-8,
.small-12 {
	margin: 12px!important;
}

selector {
	margin: 3rem!important;
}

/*___ Paddings ______________________________________________________________________________*/

.def-panel,
.large-4,
.large-8,
.slogan-panel,
.small-12 {
	padding: 12px!important;
}

.category.sex {
	padding: 6px!important;
}

/*___ Heights _______________________________________________________________________________*/

.qtip.qtip-urban .qtip-content {
	Max-height: none!important;
}

.large-8 {
    height: auto;
}

.slogan-panel .slogan {
    min-height: 126px;
}

/*___ Widths ________________________________________________________________________________*/

.row {
	max-width: none!important;
}

.large-8 {
	width: 63.66667%!important;
}

body {
	width: 98%!important;
}
}

@-moz-document domain("urbandictionary.com") {
a[href],
td span {
	color: #0ff!important;
	text-shadow: 1px 1px #000!important;
}

a[href]:visited {
	color: #fc79fc!important;
	text-shadow: 1px 1px #000!important;
}

/*_______________________________________________________________________________________________*/

a[href]:hover span,
a[href]:hover,
h1,
input[type="checkbox"]:checked+label,
input[type="radio"]:checked+label,
ul.pagination li.current a,
ul.pagination li.current button {
	color: #ff0!important;
	text-shadow: 1px 1px #000!important;
}

/*_______________________________________________________________________________________________*/

.def-panel .example,
.def-panel .meaning,
li,
p {
	color: #fff!important;
	font-weight: 700!important;
	text-shadow: 1px 1px #000!important;
}

/*__ Khaki ______________________________________________________________________________________*/

.collection-panel .title .highlight,
.word,
h1,
h2 {
	color: #F0E890!important;
	font-weight: 700!important;
	text-shadow: 1px 1px #000!important;
}

/*__ Burlywood __________________________________________________________________________________*/

h3,
h4 {
	color: #e0b880!important;
	font-weight: 700!important;
	text-shadow: 1px 1px #000!important;
}

/*__ Sandy Brown ________________________________________________________________________________*/

h5,
h6,
label {
	color: #F0A060!important;
	font-weight: 700!important;
	text-shadow: 1px 1px #000!important;
}

/*___ Blue ______________________________________________________________________________________*/

.def-panel .contributor,
.def-panel .ribbon,
time {
	color: #07beff!important;
	font-weight: 700!important;
	text-shadow: 1px 1px #000!important;
}

/*_______________________________________________________________________________________________*/

input,
input[type=email],
input[type=number],
input[type=password],
input[type=search],
input[type=tel],
input[type=text],
select,
textarea {
	background-color: #1d0909!important;
	border-radius: 22px!important;
	color: #fff!important;
}

/*_______________________________________________________________________________________________*/

::selection {
	background: #ff9!important;
	color: #000!important;
}

pre ::selection {
	background: #ff9!important;
	color: #fff!important;
}
}

@-moz-document domain("urbandictionary.com") {
/*___________________________________________________________________________________________*/

body,
html
{
	background: url(https://image.ibb.co/hVmiOe/wallpaper_with_black_background_45_free_wallpaper.jpg)!important;
	background-attachment: fixed!important;
}


/*___ Background Gray __________________________________________________________________________*/

selector {
	background-color: #060505!important;
}

/*___ Background 0000 __________________________________________________________________________*/

.panel,
.top-bar-section li:not(.has-form) a:not(.button),
.top-bar-section ul li,
ul.pagination li a:focus,
ul.pagination li button:focus,
ul.pagination li.current a,
ul.pagination li.current button,
ul.pagination li:hover a,
ul.pagination li:hover button {
	background: rgba(0, 0, 0, 0)!important;
}

/*___ Background-color 0000 ____________________________________________________________*/

#slogan-hidden .word-wrapper,
#urban-top-bar .top-bar-section li>a,
#urban-top-bar .top-bar-section li>a:hover,
#urban-top-bar,
.collection-panel .title .highlight,
.def-footer a,
.def-panel .ribbon,
.slogan-container .word-wrapper {
	background-color: rgba(0, 0, 0, 0)!important;
}

/*___ Highlight Background ______________________________________________________________*/

tbody tr:hover {
	background: linear-gradient(to right, #383838, #0000)!important;
	border-left-color: #434343!important;
}

/*__ Blue _______________________________________________________________________________*/

.button,
.cc-theme-classic .cc-btn,
.filter-panel a,
.filter-panel span,
[href*="subscribe"],
button {
	background-image: linear-gradient(to bottom right, #043dda, #000)!important;
	border-radius: 10px!important;
	border: none!important;
	box-shadow: 1px 1px 1px black, inset 2px 3px 5px rgba(0, 0, 0, 0.3), inset -2px -3px 5px rgba(255, 255, 255, 0.5)!important;
	color: #fff!important;
}

.button:hover,
.cc-theme-classic .cc-btn:hover,
.filter-panel a:hover,
.filter-panel span:hover,
[href*="subscribe"]:hover,
button:hover {
	background-image: linear-gradient(to bottom right, #154eeb, #000)!important;
	color: #ff0!important;
}

.button:active,
.cc-theme-classic .cc-btn:active,
.filter-panel a:active,
.filter-panel span:active,
[href*="subscribe"]:active,
button:active {
	box-shadow: inset 2px 2px 1px black, inset 2px 3px 5px rgba(0, 0, 0, 0.3), inset -2px -3px 5px rgba(255, 255, 255, 0.5)!important;
}

/*__ Orange _______________________________________________________________________________*/

[href*="help"] {
	background-image: linear-gradient(to bottom right, #da3a04, #000)!important;
	border-radius: 10px!important;
	border: none!important;
	box-shadow: 1px 1px 1px black, inset 2px 3px 5px rgba(0, 0, 0, 0.3), inset -2px -3px 5px rgba(255, 255, 255, 0.5)!important;
	color: #fff!important;
}

[href*="help"]:hover {
	background-image: linear-gradient(to bottom right, #eb4b15, #000)!important;
	color: #ff0!important;
}

[href*="help"]:active {
	box-shadow: inset 2px 2px 1px black, inset 2px 3px 5px rgba(0, 0, 0, 0.3), inset -2px -3px 5px rgba(255, 255, 255, 0.5)!important;
}

/*__ Blue Radial ________________________________________________________________________________*/

#urban-top-bar .top-bar-section .dropdown.alphabet-dropdown li a,
#urban-top-bar .top-bar-section .dropdown.alphabet-dropdown li span {
	color: #fff!important;
	border-radius: 22px!important;
	border: none!important;
	background: radial-gradient(ellipse at center, #1e5799 0%, #0b2338 50%, #08253e 51%, #020a11 100%)!important;
	box-shadow: 1px 1px 1px black, inset 2px 3px 5px rgba(0, 0, 0, 0.3), inset -2px -3px 5px rgba(255, 255, 255, 0.5)!important;
}

#urban-top-bar .top-bar-section .dropdown.alphabet-dropdown li a:hover,
#urban-top-bar .top-bar-section .dropdown.alphabet-dropdown li span:hover {
	background: radial-gradient(ellipse at center, #2f68aa 0%, #1c3449 50%, #19364f 51%, #131b22 100%)!important;
	color: #ff0!important;
}

#urban-top-bar .top-bar-section .dropdown.alphabet-dropdown li a:active,
#urban-top-bar .top-bar-section .dropdown.alphabet-dropdown li span:active {
	box-shadow: inset 2px 2px 1px black, inset 2px 3px 5px rgba(0, 0, 0, 0.3), inset -2px -3px 5px rgba(255, 255, 255, 0.5)!important;
}

/*__ Plain Black ______________________________________________________________________________*/

.large-4,
.large-8,
.panel.categories-panel,
.panel.trending-words-panel,
.slogan-panel,
.small-12 {
	background-color: #000!important;
	border-radius: 22px!important;
	border: 1px solid rgba(0, 0, 0, .25)!important;
	box-shadow: inset 0 0 5px rgba(0, 0, 0, .4), rgba(55, 55, 55, 1) 0 1px 0, 10px 10px 5px rgba(0, 0, 0, .4), rgba(155, 155, 155, 1) 0 1px 0!important;
}

