	box-shadow: inset 0 0 5px rgba(0, 0, 0, .4), rgba(155, 155, 155, 1) 0 1px 0, 10px 10px 5px rgba(10, 10, 10, .4), rgba(155, 155, 155, 1) 0 1px 0!important;
}

/*__ Plain ___________________________________________________________________________________*/

#urban-top-bar .top-bar-section .dropdown,
.def-panel,
.qtip.qtip-urban {
	background-color: #111!important;
	border-radius: 22px!important;
	border: 1px solid rgba(0, 0, 0, .25)!important;
	box-shadow: inset 0 0 5px rgba(0, 0, 0, .4), rgba(55, 55, 55, 1) 0 1px 0, 10px 10px 5px rgba(0, 0, 0, .4), rgba(155, 155, 155, 1) 0 1px 0!important;
}

#urban-top-bar .top-bar-section .dropdown:hover,
.def-panel:hover,
.qtip.qtip-urban:hover {
	box-shadow: inset 0 0 5px rgba(0, 0, 0, .4), rgba(155, 155, 155, 1) 0 1px 0, 10px 10px 5px rgba(10, 10, 10, .4), rgba(155, 155, 155, 1) 0 1px 0!important;
}

/*__ Red Gradient ______________________________________________________________________________*/

.cc-banner.cc-bottom,
.category.sex,
.top-bar {
	background: linear-gradient(to bottom, #300202 0%, #590505 100%)!important;
	border-bottom: 1px solid #000!important;
	border-radius: 22px!important;
}

/*__ Blue Gradient ______________________________________________________________________________*/

.circle-button {
	background: radial-gradient(ellipse at center, #1e5799 0%, #0b2338 50%, #08253e 51%, #020a11 100%)!important;
	border-bottom: 1px solid #000!important;
	border-radius: 22px!important;
}

/*__ Facebook ________________________________________________________________________________*/

.slogan-panel .like_buttons [href*="facebook"] {
	background-image: linear-gradient(to bottom right, #3b5998, #000)!important;
	border-radius: 10px!important;
	border: none!important;
	box-shadow: 1px 1px 1px black, inset 2px 3px 5px rgba(0, 0, 0, 0.3), inset -2px -3px 5px rgba(255, 255, 255, 0.5)!important;
	color: #fff!important;
}

.slogan-panel .like_buttons [href*="facebook"]:hover {
	background-image: linear-gradient(to bottom right, #4c6aa9, #000)!important;
	color: #ff0!important;
}

.slogan-panel .like_buttons [href*="facebook"]:active {
	box-shadow: inset 2px 2px 1px black, inset 2px 3px 5px rgba(0, 0, 0, 0.3), inset -2px -3px 5px rgba(255, 255, 255, 0.5)!important;
}

/*__ Twitter ________________________________________________________________________________*/

.slogan-panel .like_buttons [href*="twitter"] {
	background-image: linear-gradient(to bottom right, #1da1f2, #000)!important;
	border-radius: 10px!important;
	border: none!important;
	box-shadow: 1px 1px 1px black, inset 2px 3px 5px rgba(0, 0, 0, 0.3), inset -2px -3px 5px rgba(255, 255, 255, 0.5)!important;
